var customCampaignDataConfig ={};
customCampaignDataConfig.ChartDisplayFormets = {
    "year":{ "year": "YYYY"},
    "datetime":{"datetime": "MMM D, YYYY, h:mm:ss a"},
    "millisecond": {"millisecond": "h:mm:ss.SSS a"},
    "second": {"second": "h:mm:ss a"},
     "minute":{"minute": "h:mm a"},
     "hour":{"hour": "hA"},
     "day":{"day": "MMM D"},
     "week":{"week": "ll"},
     "month":{"month": "MMM YYYY"},
     "quarter":{"quarter": "[Q]Q - YYYY"}
};
customCampaignDataConfig.ChartSelectedFormet ="year";
customCampaignDataConfig.chart = {};
customCampaignDataConfig.chart.options = {
                scales: {
                    x: {
                        type: "time",
                        time: {
                            unit: customCampaignDataConfig.ChartSelectedFormet, 
                            displayFormats: customCampaignDataConfig.ChartDisplayFormets[customCampaignDataConfig.ChartSelectedFormet]
                        },

                        title: {
                            display: true,
                            text: 'Date',
                            color: '#911',
                            font: {
                                family: 'Comic Sans MS',
                                size: 20,
                                weight: 'bold',
                                lineHeight: 1.2,
                            },
                            padding: {top: 20, left: 0, right: 0, bottom: 0}
                        },

                        ticks: {
                            display: true, 
                            color: 'green'
                        }
                        
                    },
                    y: {
                        title: {
                            display: true,
                            text: "Number of Users",
                            color: '#911',
                            font: {
                                family: 'Comic Sans MS',
                                size: 20,
                                weight: 'bold',
                                lineHeight: 1.2,
                            },
                            padding: {top: 20, left: 0, right: 0, bottom: 0}
                        },
                        ticks: {
                            display: true, 
                            color: 'Blue'
                        },
                       
                    }
                },

                elements: {
                        point: {
                            radius: 4, // Set the radius of the dots
                            borderWidth: 2, // Set the border width of the dots
                            backgroundColor: 'rgba(75, 192, 192, 1)', // Set the background color of the dots
                            borderColor: 'rgba(75, 192, 192, 1)', // Set the border color of the dots
                            hitRadius: 10, // Set the radius for hit detection
                            hoverRadius: 6, // Set the radius for hover effect
                        }
                    },
                    plugins: {
                        datalabels: {
                            display: false, // Hide the default data labels
                        }
                    }
            };


        // Helper function to get a random color
        const getRandomColor = () => {
            const letters = "0123456789ABCDEF";
            let color = "#";
            for (let i = 0; i < 6; i++) {
                color += letters[Math.floor(Math.random() * 16)];
            }
            return color;
        };

        // Function to aggregate data by timeframe (day, month, year)
        const aggregateDataByTimeframe = (data, timeframe) => {
            const aggregatedData = {};

            data.forEach(item => {
                const date = moment(item[8], "MMMM D, YYYY h:mm A");
                const dateKey = getDateKey(date, timeframe);
                const source = item[4];

                if (!aggregatedData[source]) {
                    aggregatedData[source] = {};
                }

                if (!aggregatedData[source][dateKey]) {
                    aggregatedData[source][dateKey] = 0;
                }

                aggregatedData[source][dateKey]++;
            });

            return aggregatedData;
        };

        const generateDatasets = (timeframe, data) => {
            const datasets = [];
            const aggregatedData = aggregateDataByTimeframe(data, timeframe);

            for (const source in aggregatedData) {
                const dataPoints = Object.entries(aggregatedData[source]);
                datasets.push({
                    label: source,
                    // data: dataPoints.map(([date, count]) => ({ x: date, y: count })),
                    data: dataPoints.map(([date, count]) => ({ x: date, y: count })),
                    fill: false,
                    borderColor: getRandomColor(),
                });
            }
            return {
                datasets,
            };
      };

      // Function to get date key based on timeframe
        const getDateKey = (date, timeframe) => {
            switch (timeframe) {
            case "year":
                return date.format("YYYY");
            case "month":
                return date.format("YYYY-MM");
            case "day":
                return date.format("YYYY-MM-DD");
            case "hour":
                return date.format("YYYY-MM-DD HH");
            case "minute":
                return date.format("YYYY-MM-DD HH:mm");
            case "second":
                return date.format("YYYY-MM-DD HH:mm:ss");
            case "millisecond":
                return date.format("YYYY-MM-DD HH:mm:ss.SSS");
            case "week":
                return date.isoWeek().toString();
            case "quarter":
                return Math.ceil(date.month() / 3).toString();
            default:
                return ""; // Handle unsupported timeframe
        }


        };

        const ctx = document.getElementById('myChart');
        const myChart =   new Chart(ctx, {
            type: "line",  
            data: generateDatasets(customCampaignDataConfig.ChartSelectedFormet,jsonData.data), 
            options: customCampaignDataConfig.chart.options,
            plugins: [ 
                ChartDataLabels,
                
            ],
        });



        flatpickr("#dateRange", {
            mode: "range",
            dateFormat: "Y-m-d", // Adjust the date format as needed
            defaultDate: [new Date().fp_incr(-30), new Date()],
          maxDate: new Date(),
            onClose: function (selectedDates) {
                // Update the chart based on the selected date range
                updateChart(selectedDates);
            }
        });

        const updateChart = (selectedDates) => {
            if(selectedDates.length !== 2 ) return;
            debugger;

            const startDate = selectedDates[0];
            const endDate = selectedDates[1];

            const filteredData = jsonData.data.filter(item => {
            const date = moment(item[8], "MMMM D, YYYY h:mm A");
            return date.isBetween(startDate, endDate, null, '[]'); // '[]' includes both start and end dates
        })
        .sort((a, b) => {
            const dateA = moment(a[8], "MMMM D, YYYY h:mm A");
            const dateB = moment(b[8], "MMMM D, YYYY h:mm A");
            return dateA - dateB;
        });

            customCampaignDataConfig.ChartSelectedFormet = customCampaignDataConfig.ChartSelectedFormet;
            myChart.options.scales.x.time.unit = customCampaignDataConfig.ChartSelectedFormet;
            myChart.options.scales.x.time.displayFormats = customCampaignDataConfig.ChartDisplayFormets[customCampaignDataConfig.ChartSelectedFormet];
           myChart.data =  generateDatasets(customCampaignDataConfig.ChartSelectedFormet,filteredData);
           myChart.update();
        };





     


    document.addEventListener("readystatechange", (event) => {
        if (event.target.readyState == 'complete') {

            /** Adding eventlistner on change **/
            const select = document.querySelector(`#select_view_type`);
            select.addEventListener('change',function(e){
                let value = e.target.value;
                customCampaignDataConfig.ChartSelectedFormet = value;

                /*** Updating the chart ****/
                customCampaignDataConfig.ChartSelectedFormet = customCampaignDataConfig.ChartSelectedFormet;
                myChart.options.scales.x.time.unit = customCampaignDataConfig.ChartSelectedFormet;
                myChart.options.scales.x.time.displayFormats = customCampaignDataConfig.ChartDisplayFormets[customCampaignDataConfig.ChartSelectedFormet];
                myChart.update();
            });

             /** Adding eventlistner on change **/




        }  /*** Ready State Change to `complete` ***/
    });
    
</script>


